func compare(a, b [][]int) bool {
	if len(a) != len(b) {
		return false
	}

	for _, v := range a {
		sort.Ints(v)
	}

	sort.Slice(a, func(i, j int) bool {
		return a[i][0] < a[j][0]
	})

	return reflect.DeepEqual(a, b)
}
